  {
    path: '/404',
    guard: RouterGuard,
    element: React.lazy(() => import('src/views/errors/NotFoundView')),
  },
  {
    path: '/login',
    guard: RouterGuard,
    element: React.lazy(() => import('src/views/signIn')),
  },
  // customize  routes
  {
    path: '/memu/*',
    guard: LoginGuard,
    layout: DashboardLayout,
    element: React.lazy(() => import('src/views/menu')),

    childs: [
